From Hopeless Records Site:
\&quot;15 new accoustic songs from Jeff Ott of Fifteen. Finally an artist who\&amp;#039;s not afraid to ask the tough and controversial social questions. Includes additional tracks from the out of print Epythesial Union and the Accoustic tracks from various Fifteen albums. *A portion of the proceeds earned by the artist and Sub City from the sale of this title will be donated to the Ruckus Society, a non-profit organization from Okland, California that provides instruction in strategic campaigning, action planning and strategy, media communications training, grassroots organizing, and non violence philosophy techniques and support to a wide array of struggles for the environment, human rights and social justice.\&quot;

Buy this if you can, but I know a lot of you bastards are broke.  I definitely am, but I bought this when I had a job.
